# Query 1 - total number of loans disbursed between 9th Dec 2015
# and 17th Oct 2017 (both dates included).
print('===========================================================')
print('QUERY REPORT')
print('===========================================================\n')
print('Query - 1')
print('==============')
cur.execute('''
SELECT COUNT(*)
FROM Borrowings
WHERE ((BRW_DisbursalDate >= '2015-12-09 00:00:00.000') AND
(BRW_DisbursalDate <= '2017-10-17 23:59:59.999'))
''')
loan_qry1 = cur.fetchall()
# no_loan = len(loan_qry1)
print('Total number of loans disbursed between 9th Dec 2015 and 17th Oct 2017:',loan_qry1)
print('\n')

# Query 2 - Which year / month had the most loans with state 'Withdrawn'
#  (list top three with highest number of disbursals).
print('Query - 2')
print('==============')
cur.execute('''
SELECT strftime('%Y',BRW_DisbursalDate) AS BRW_Disbursal_Year, COUNT (BRW_DisbursalDate) AS Loan_Withdrawn_Number
FROM Borrowings WHERE (BRW_State = 'Withdrawn') GROUP BY strftime('%Y',BRW_DisbursalDate) ORDER BY BRW_Disbursal_Year DESC LIMIT 3
''')
loan_qry2 = cur.fetchall()
print('Top Years with Highest number of disbursals:\n [YYYY, Number of disbursals]\n',loan_qry2)
print('\n')

# Querr 3 - Check for duplicate records
print('Query - 3')
print('==============')
cur.execute('''
SELECT REP_ID, COUNT(*)
FROM Repayments
Group BY REP_ID
HAVING COUNT(*) >1
''')
loan_qry3 = cur.fetchall()
print('Duplicate Repayment Records:',loan_qry3)
print('\n')

# Query 4 - For each term, return total number of loans that have failed
# repayments.
print('Query - 4')
print('==============')
cur.execute('''
SELECT BRW_Term, REP_State, COUNT(BRW_Term) AS Repayment_Fail_count FROM Borrowings, Repayments
WHERE Borrowings.BRW_ID = Repayments.REP_Borrowing AND REP_State = 'Failed' GROUP BY BRW_Term
''')
loan_qry4 = cur.fetchall()
print('Total number of loans that have failed repayments for each term:\n [BRW_Term, REP_State, Fail Count]\n',loan_qry4)
print('\n')

# Query 5 - Find all loans with state 'Withdrawn' that have no repayments.
print('Query - 5')
print('==============')
cur.execute('''
SELECT BRW_ID, BRW_State, REP_Amount, REP_State
FROM Borrowings, Repayments WHERE Borrowings.BRW_ID = Repayments.REP_Borrowing AND BRW_State = 'Withdrawn' AND REP_State = 'Failed'
''')
loan_qry5 = cur.fetchall()
print('Loans with state Withdrawn that have no repayments:\n [BRW_ID, BRW_State, REP_Amount, REP_State]\n',loan_qry5)
print('\n')

# Query 6 - Return the latest 3 repayment dates for each loan with state
# 'Withdrawn', all three dates should be on a single row.
print('Query - 5')
print('==============')
cur.execute('''
SELECT BRW_ID, group_concat(REP_RepaymentDate) AS Repayment_Dates
FROM Borrowings, Repayments
WHERE Borrowings.BRW_ID = Repayments.REP_Borrowing AND BRW_State = 'Withdrawn'
GROUP BY BRW_ID
ORDER BY group_concat(REP_RepaymentDate) DESC
''')
loan_qry6 = cur.fetchall()
print('Repayment dates for each loan:\n [BRW_ID, Repayment_Dates]\n', loan_qry6)
print('\n')

# Close connection to the db
cur.close()
